import React from 'react';
import { Link } from 'react-router-dom';
import '../../CodeCSS/App.css';

const Dashboard = () => {
  const menuItems = [
    { path: "/profile", icon: "üë§", label: "Profile" },
    { path: "/settings", icon: "‚öôÔ∏è", label: "Settings" },
    { path: "/about", icon: "‚ÑπÔ∏è", label: "About Us" },
    { path: "/help", icon: "‚ùì", label: "Help" },
    { path: "/", icon: "üè†", label: "Home", className: "dashboard-link landing-page" }
  ];

  return (
    <div className="dashboard">
      <header className="dashboard-header">
        <h3>Menu</h3>
      </header>

      <nav>
        <ul className="dashboard-links">
          {menuItems.map((item, index) => (
            <li key={index}>
              <Link
                to={item.path}
                className={item.className || "dashboard-link"}
              >
                <span className="link-icon">{item.icon}</span>
                {item.label}
              </Link>
            </li>
          ))}
        </ul>
      </nav>
    </div>
  );
};

export default Dashboard;
